window.bookSummaryJSON = "<p>A gripping new fantasy series by <i>USA Today</i> best-selling authors Jaymin Eve and Leia Stone. </p> <p>Arianna is a queen heir and at 20 years old she's now eligible for the crown of wolf shifters. Heirs are trained and groomed so that they're ready should the queen perish during their time of eligibility. </p> <p>Of course, there's little chance of that happening. The Red Queen has stood for a century, and her power is beyond reckoning. </p> <p>Or so Arianna believes, right up until the final tolling of the bells. The queen has fallen. Four heirs will now fight it out for the crown. </p> <p>Let the summit begin. </p>"; 
